"use strict";(self.webpackChunkdocs_fintesk_com=self.webpackChunkdocs_fintesk_com||[]).push([[5309],{95604:e=>{e.exports=JSON.parse('{"tag":{"label":"Basic concepts","permalink":"/es/tags/basic-concepts","allTagsPath":"/es/tags","count":8,"items":[{"id":"kb/getting-started/how-can-i-delete-items-in-fintesk","title":"\xbfC\xf3mo puedo eliminar los elementos en Fintesk?","description":"Dependiendo de la situaci\xf3n, es posible que deba eliminar elementos en Fintesk de muchas maneras diferentes. Hemos construido varios formas diferentes para eliminar elementos en Fintesk y ayudar a abordar cualquier situaci\xf3n.","permalink":"/es/kb/getting-started/how-can-i-delete-items-in-fintesk"},{"id":"kb/getting-started/how-is-fintesk-data-organized","title":"\xbfC\xf3mo se organizan los datos de Fintesk?","description":"Organizar sus negocios, contactar personas, organizaciones, actividades o productos es esencial para su proceso de ventas. Fintesk lo ayuda a organizar todos sus elementos y vincularlos para una mejor visibilidad.","permalink":"/es/"},{"id":"kb/getting-started/what-is-the-difference-between-a-user-and-a-seat","title":"\xbfCu\xe1l es la diferencia entre un usuario y un asiento?","description":"En Fintesk, su suscripci\xf3n se calcula por el n\xfamero de asientos que tiene en su cuenta. Un usuario activo (o invitado) siempre tomar\xe1 un asiento una vez que se hayan agregado a Fintesk, pero es posible tener asientos vac\xedos si los usuarios han sido desactivados o a\xfan no han agregado.","permalink":"/es/kb/getting-started/what-is-the-difference-between-a-user-and-a-seat"},{"id":"kb/getting-started/search-finding-what-you-need","title":"Encontrando lo que necesitas","description":"La barra de b\xfasqueda en Fintesk le permite encontrar y acceder r\xe1pidamente a cualquier negocio, contactos, actividades y productos en tu cuenta de Fintesk.","permalink":"/es/kb/getting-started/search-finding-what-you-need"},{"id":"kb/getting-started/fintesk-glossary","title":"Glosario de Fintesk","description":"Al usar Fintesk o navegar por las muchas gu\xedas de ayuda en nuestra base de conocimiento, puede encontrar t\xe9rminos con los que no est\xe1 familiarizado o desea aclarar. En esos casos, \xa1nuestro glosario podr\xeda resultar muy \xfatil!","permalink":"/es/kb/getting-started/fintesk-glossary"},{"id":"kb/getting-started/interface-in-fintesk","title":"Interfaz Fintesk","description":"La interfaz es el lugar donde puede interactuar con el software Fintesk y realizar un seguimiento de sus ventas y datos. Como vendedor ocupado, es posible que deba moverse r\xe1pidamente en la aplicaci\xf3n Fintesk para encontrar la informaci\xf3n que sea m\xe1s relevante para usted.","permalink":"/es/kb/getting-started/interface-in-fintesk"},{"id":"kb/getting-started/organization-vs-company-account","title":"Organizaci\xf3n vs. cuenta de la empresa","description":"Cuando se crea una cuenta de Fintesk, se crean una cuenta de usuario y la propia cuenta de la empresa.","permalink":"/es/kb/getting-started/organization-vs-company-account"},{"id":"kb/getting-started/fintesk-user-vs-company-account","title":"Usuario de Fintesk vs. Cuenta de la empresa","description":"Cuando se crea una cuenta de Fintesk, se crean una cuenta de usuario y una cuenta de la empresa.","permalink":"/es/kb/getting-started/fintesk-user-vs-company-account"}],"unlisted":false}}')}}]);